            {
                if (order < 1)
                {
                    throw new ArgumentException(String.Format(ExceptionMessages.ArgumentOutOfRangeGreaterEqual, "order", 2), nameof(order));
                }
                if (order > sm_Weights.Length)  // we cache the first 250 weights and abscissas (for higher order, the most weights are 0.0)
                {
                    var abscissas = new double[(order + 1) / 2];
                    weights = new double[(order + 1) / 2];
                    ComputeCoefficients(order, abscissas, weights);

                    return abscissas;
                }
                weights = sm_Weights[order - 1];
                return sm_Abscissas[order - 1];
            }

#if DEBUG
            /// <summary>Writes weights and abscissas of the Gauss-Hermite Quadrature up to a specific order into a specific file.
            /// </summary>
            /// <param name="maxOrder">The maximal order.</param>
            /// <param name="filePath">The file path.</param>
            public static void Write(int maxOrder, string filePath)
            {
                var weightsStringBuilder = new StringBuilder();
                var abscissaStringBuilder = new StringBuilder();

                weightsStringBuilder.AppendLine("private static double[][] sm_Weights = {");
                abscissaStringBuilder.AppendLine("private static double[][] sm_Abscissas = {");


                for (int order = 1; order < maxOrder - 1; order++)
                {
                    var weights = new double[order];
                    var abscissas = new double[order];

                    ComputeCoefficients(order, abscissas, weights);

                    weightsStringBuilder.Append("\t new[] {");
                    abscissaStringBuilder.Append("\t new[] {");

                    weightsStringBuilder.AppendFormat(" {0},", weights[0].ToString("F17", CultureInfo.InvariantCulture));
                    weightsStringBuilder.AppendLine();
                    abscissaStringBuilder.AppendFormat(" {0},", abscissas[0].ToString("F17", CultureInfo.InvariantCulture));
                    abscissaStringBuilder.AppendLine();

                    for (int k = 1; k < order; k++)
                    {
                        weightsStringBuilder.AppendFormat("\t         {0},", weights[k].ToString("F17", CultureInfo.InvariantCulture));
                        weightsStringBuilder.AppendLine();
                        abscissaStringBuilder.AppendFormat("\t         {0},", abscissas[k].ToString("F17", CultureInfo.InvariantCulture));
                        abscissaStringBuilder.AppendLine();
                    }
                    weightsStringBuilder.AppendLine("\t       },");
                    abscissaStringBuilder.AppendLine("\t       },");
                }
                weightsStringBuilder.AppendLine("\t\t};");
                abscissaStringBuilder.AppendLine("\t\t};");

                var stream = File.CreateText(filePath);
                stream.WriteLine(weightsStringBuilder.ToString());
                stream.WriteLine(abscissaStringBuilder.ToString());

                stream.Close();
            }
#endif
            #endregion

            #region private (static) methods

            /// <summary>Computes the weights and evaluation points (=abscissas) with respect to the Gauss-Hermite Quadrature.
            /// </summary>
            /// <param name="n">The order of the Gauss-Hermite Quadrature, i.e. the number of points.</param>
            /// <param name="abscissas">The <paramref name="n"/> abscissas of the Gauss-Hermite Quadrature (output).</param>
            /// <param name="weights">The <paramref name="n"/> weights of the Gauss-Hermite Quadrature (output).</param>
            /// <param name="maxNumberOfRootIterations">The maximal number of iterations used for the Newton Approach.</param>
            /// <param name="tolerance">The (positive) tolerance used as exit condition for the Newton approach.</param>
            /// <exception cref="ArithmeticException">Thrown if a problem occurs while computing the roots of the Hermite polynomials.</exception>
            private static void ComputeCoefficients(int n, double[] abscissas, double[] weights, int maxNumberOfRootIterations = 1000, double tolerance = MachineConsts.SuperTinyEpsilon)
            {
                /* compute the zeros of the n-th (normalized) Hermit-Polynomial for the physicist view, 
                 * which is given via the recursive relation
                 *  
                 *  H_{j+1}(x) = x * sqrt(2/(j+1))* H_j(x) - sqrt(j/(j+1)) * H_{j-1}
                 * 
                 *  H_{-1} = 0; H_0 = 1 / pi^{1/4}.
                 * 
                 * The derivative of H_n is given by (see 'Numerical recipes', § 4.5)
                 * 
                 * H_j'(x) = sqrt(2 * j) * H_{j-1}.
                 * 
                 * This makes it easy to apply the Newton-Method with a good initial value.
                 * 
                 * Remark:
                 * If necessary the case of a probabilist view has to be implemented as well, i.e. for the 
                 * weight w(x) = exp(-x^2/2). A transformation is possible but not practicable because of
                 * some multiplication with 2^n.
                 */
                double x = 0.0;

                for (int i = 0; i <= (n + 1) / 2 - 1; i++)  // a symmetric problem
                {
                    /* initial point of the Newton-Method: */
                    switch (i)
                    {
                        case 0:
                            x = Math.Sqrt(2 * n + 1) - 1.85575 * Math.Pow(2 * n + 1, -0.16667);
                            break;

                        case 1:
                            x -= 1.14 * Math.Pow(n, 0.426) / x;
                            break;

                        case 2:
                            x = 1.86 * x - 0.86 * abscissas[0];
                            break;

                        case 3:
                            x = 1.91 * x - 0.91 * abscissas[1];
                            break;

                        default:
                            x = 2 * x - abscissas[i - 2];
                            break;
                    }

                    bool foundRoot = false;
                    int k = 1;

                    while ((k <= maxNumberOfRootIterations) && (foundRoot == false))
                    {
                        /* computes H_n(x): */
                        double hPreviousValue = 0.0;
                        double hValue = MathConsts.PiToMinusOneOverFour;  // = 1 / Math.Pow(Math.PI, 0.25);

                        for (int j = 1; j <= n; j++)
                        {
                            double pTempValue = hPreviousValue;
                            hPreviousValue = hValue;

                            hValue = x * Math.Sqrt(2.0 / j) * hPreviousValue - Math.Sqrt((j - 1.0) / j) * pTempValue;
                        }
                        double derivative = Math.Sqrt(2 * n) * hPreviousValue;
                        double xTemp = x;

                        /* use Newton's method: */
                        x = x - hValue / derivative;
                        if (Math.Abs(x - xTemp) < tolerance)
                        {
                            foundRoot = true;

                            abscissas[i] = x;
                            abscissas[n - 1 - i] = -x;
                            weights[i] = 2.0 / (derivative * derivative);
                            weights[n - 1 - i] = weights[i];
                        }
                        k++;
                    }

                    if (k >= maxNumberOfRootIterations)
                    {
                        throw new ArithmeticException(String.Format("Could not compute the root of a specific Hermite polynomial of degree {0}; null-based index of the root: {1}.", n, i));
                    }
                }
            }
            #endregion
        }
    }
